import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import BlogFeeds from "./components/blog/BlogFeeds";
import BlogDetails from "./components/blog/BlogDetails";
import AboutMe from "./components/aboutMe/AboutMe";
// import HireMe from "./components/hireMe/HireMe";
import ThankYou from "./components/thankYou/ThankYou";
import NavBar from "./components/navBar/NavBar";
import { lazy, Suspense } from "react";
import { ErrorBoundary } from "react-error-boundary";

const HireMe = lazy(() => import("./components/hireMe/HireMe"));

function App() {
  return (
    <BrowserRouter>
      <NavBar />
      <Routes>
        <Route exact path="/" element={<BlogFeeds />} />
        <Route exact path="/:slug" element={<BlogDetails />} />
        <Route exact path="/me" element={<AboutMe />} />
        {/* <Route exact path="/hire-me" element={<HireMe />}  */}
        <Route
          exact
          path="/hire-me"
          element={
            <ErrorBoundary
              FallbackComponent={ErrorFallback}
              onReset={() => navigate("/")}
            >
              <Suspense>
                <HireMe />
              </Suspense>
            </ErrorBoundary>
          }
        />

        <Route exact path="/thank-you" element={<ThankYou />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
